import React from "react";
import { connect } from "react-redux";
const Favoritos = ({ favoritos, dispatch }) => {
  console.log(favoritos);
  return (
    <div>
      <p>Favoritos</p>
    </div>
  );
};

const mapStateToProps = (state) => ({
  favoritos: state.data.favoritos,
